import React from 'react';
import AddRecipeForm from './components/AddRecipeForm';
import RecipesByCuisine from './components/RecipesByCuisine';
import CommonIngredients from './components/CommonIngredients';
import RandomRecipe from './components/RandomRecipe';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <h1>Recipe App</h1>
      <AddRecipeForm />
      <RecipesByCuisine />
      <CommonIngredients />
      <RandomRecipe />
    </div>
  );
};

export default App;
